import React from "react";
import "./style.css";

function Design() {
  return (
    <div>

        <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 justify-content-sm-center">
          <div className="wrapper position-relative mb-4">
            <a href="https://www.tropicalblvd.com/">
              <img className="img-fluid" id="apparel-image"
                src="https://img1.wsimg.com/isteam/ip/f1f1e6b7-f1ae-484d-bf7a-5fc27243e99d/0110fb0c-d89b-4ac0-9aff-7b5f9fa7e807.jpg/:/cr=t:40.72%25,l:38.3%25,w:19.95%25,h:26.6%25/rs=w:365,h:365,cg:true,m"
                alt="Apparel Design" />
              <div className="box-3 position-absolute">Design</div>
            </a>
          </div>
        </div>

    </div>
  );
}

export default Design;
